import React, { useEffect, useState } from 'react'
import './Systemblock.css'

function Systemblock(props) {

    let [systemarr, setsystemarr] = useState([])

    useEffect(()=>{
        console.log(props.lang)
        fetch('http://localhost:8080/text/bestseller/'+props.lang)
        .then(res=>res.json())
        .then(json=>setsystemarr(json))
    },[props.lang])
  return (
    <>
    <div>Systemblock</div>
    <h1>{props.lange}</h1>
    {console.log(systemarr)}
    </>
  )
}

export default Systemblock
